import React from "react";
import Card from './Card'

export default class CardsContainer extends React.Component{
    render(){
        return (
            <div className="cards">
                    {this.state.nearestEvents.map(event => <Card key={event.Name} event={event} showEventInfo={this.props.showEventInfo} />)}
            </div>
        );
    }
}
